import React from 'react'
import {Link} from 'react-router'

const RegisterListItem = ({client}) => {
    return (
        <Link to={"/client/" + `${client.id}`} className="register-list__item">
            <div className="register-list__name">{client.name}</div>
            <div className="register-list__surname">{client.secondName}</div>
        </Link>
    )
};

export default RegisterListItem